settings.css:
body { background-color: rgba(0, 0, 0, 0); margin: 0px auto; overflow: hidden; }
#d_footer /*, #container **/ {
display: none;
}
canvas#mycanvas {
display: inline-block !important;
}

body, *, body::after, body::before { background-image: none !important; background-color: rgba(0, 0, 0, 0) !important; margin: 0px auto; overflow: hidden; }
.block clockonly,.block clockonly *{
	background: none;
 background-color: rgba(0, 0, 0) !important; 
}

html{
width: 100%;
}
body {
width: 100%;
}
table, tr {
width: 100%;
}

table:nth-child(odd){
background: linear-gradient(0deg, #0a00,#0a08);
}
td:nth-child(2){
background: linear-gradient(0deg, #0a00,#0a08);
}
tr, table,td {
border-radius: 16px 16px 16px 16px ;

}
tr,td {
padding-left: 8px;
max-height: 32px;
overflow: hidden;
padding-right: 8px;
}

hr {
border: 2px solid #0000;
}

/* Global overrides */
* {
	background-color: rgba(0, 0, 0, 0) !important;
	overflow: hidden !important;

}
